INSERT INTO `cgFormulariosPqrsDetalle` (`idCgFormulariosPqrsDetalle`, `idCgFormulariosPqrs`, `nombreCgFormulariosPqrsDetalle`, `descripcionCgFormulariosPqrsDetalle`, `adjuntarDocsCgFormulariosPqrsDetalle`, `terminosCgFormulariosPqrsDetalle`, `datosSelectorPrestacionCgFormulariosPqrsDetalle`, `datosSelectorBeneficiarioCgFormulariosPqrsDetalle`, `activarBeneficiarioCgFormulariosPqrsDetalle`, `idTipoDocumentalCgFormulariosPqrsDetalle`, `idSerieCgFormulariosPqrsDetalle`, `idSubserieCgFormulariosPqrsDetalle`, `estadoCgFormulariosPqrsDetalle`, `creacionCgFormulariosPqrsDetalle`) VALUES
(1, 1, 'Pensión de invalidez', 'Prestación económica que se reconoce al afiliado que se ha calificado como inválido por haber perdido el 50% o más de su capacidad laboral y cumpla los requisitos en cuanto a semanas de cotización establecidos en la ley vigente al estructurarse la invalidez.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.\r\n<br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />-Registro Civil de Nacimiento Autentico<br />-Dictamen médico laboral emitido por la Junta Regional o Nacional de Calificación de invalidez, si se cuenta con este, sino deberá solicitar previamente la calificación de pérdida de capacidad laboral ante Fonprecon adjuntando: Documento de identidad, Declaración del domicilio y Historia clínica actualizada<br />-Constancia de ejecutoria del dictamen de calificación de pérdida de capacidad laboral<br />-Certificado de pago de incapacidades emitido por la EPS correspondiente', '', '', '', 2575, 179, 663, 10, '2022-10-24 11:52:00'),
(2, 1, 'Pensiones de vejez o jubilación', 'Para ser acreedor el afiliado debe cumplir los requisitos de la Ley vigente en el momento de adquirir el derecho pensional, a partir del año 2015, son: Tiempo de servicio (1300 semanas) y edad (57 años mujer y 62 hombre).', ' Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos. <br /> <br /> * El formato soportado para la carga de anexos es PDF.  <br />  * Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos: <br /><br />-Registro Civil de Nacimiento Auténtico', '', '', '', 2575, 179, 663, 10, '2022-10-24 11:52:25'),
(3, 1, 'Pensión Familiar', 'Es un tipo de pensión de vejez equivalente a un salario mínimo legal vigente, resultado de la suma de esfuerzos de cotización o aportes de cada uno de los cónyuges o cada uno de los compañeros permanentes, cuando ninguno de los dos cumple los requisitos exigidos para pensión, han cumplido las edades mínimas requeridas y se encuentran imposibilitados para continuar cotizando.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />-Registro Civil de Nacimiento Auténtico<br />-Registro Civil de Matrimonio (Auténtico y con una vigencia no mayor a 3 meses)<br /> -Declaración juramentada extra-proceso de relación conyugal o convivencia permanente no inferior a cinco (5) años (circunstancias de tiempo, modo y lugar)', '', '', '', 2575, 179, 666, 10, '2022-10-24 12:01:15'),
(4, 1, 'Reliquidación de pensión', 'Es la realización de un nuevo estudio de la pensión de vejez, invalidez o muerte previamente reconocida por FONPRECON.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Ninguna', '', '', '', 2575, 179, 664, 10, '2022-10-24 12:01:15'),
(5, 1, 'Retroactivo pensional por inclusión en nómina', 'El retroactivo pensional es el reconocimiento y pago de las mesadas pensionales reconocidas al solicitante de la pensión, desde la fecha de la efectividad de la prestación económica hasta la fecha que ingreso a nómina, ', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente  a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, después de la radicación virtual, los ORIGINALES de los siguientes documentos: <br /><br />  -la afiliación en salud y acto administrativo', '', '', '', 2575, 179, 663, 10, '2022-10-24 12:01:15'),
(6, 2, 'Designación en vida de beneficiarios – Ley 44/80 - Ley 1204/08', 'El pensionado por vejez o invalidez que en vida desee facilitar el traspaso de su pensión a sus posibles beneficiarios, deberá dirigir memorial en tal sentido a Fonprecon aportando los documentos señalados en la normatividad vigente.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />-Solicitud escrita y firmada manifestando su deseo de sustituir su pensión a una persona determinada<br />-Declaración juramentada de convivencia: manifestando los extremos temporales de la convivencia: que se entiende con la firma del documento, si el designado como beneficiario es el cónyuge o la compañera (o) permanente.', '', '', '', 2575, 179, 666, 10, '2022-10-24 12:01:15'),
(7, 2, 'Sustitución Pensional (muerte pensionado)', 'Es la prestación económica que se concede a los miembros del grupo familiar del pensionado por vejez o invalidez por riesgo común que fallezca (sustitución), o a los miembros del grupo familiar del afiliado que fallezca (pensión de sobrevivientes), cumpliendo los requisitos de la Ley vigente en el momento que acaece el riesgo de fallecimiento.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />-Registro Civil de Defunción (Auténtico y con una vigencia no mayor a 3 meses)<br />-En el evento de tratarse de un beneficiario invalido, que requiera personas de apoyo, de acuerdo con lo señalado en la Ley 1996 de 2019, debe allegar la providencia autentica de designación y posesión.<br /><br />RESPECTO DE CONYUGE O COMPAÑERA (O) PERMANENTE<br />-Registro Civil de Matrimonio CON NOTAS MARGINALES (Auténtico y con una vigencia no mayor a 3 meses)<br />-Registro Civil de Nacimiento del solicitante (Auténtico y con una vigencia no mayor a 3 meses y con notas marginales)<br />- declaraciones juramentadas de convivencia cinco años anteriores a la muerte del causante, manifestando los extremos temporales de la convivencia.<br /><br />RESPECTO DE LOS HIJOS<br />-Registro Civil de Nacimiento Autentico<br />-Certificado de estudios<br />-Dictamen de Calificación de Pérdida de Capacidad Laboral<br />-Declaración juramentada de dependencia económica.<br /><br />RESPECTO DE LOS PADRES<br />- Registro civil de nacimiento auténtico del afiliado fallecido<br />-Declaración juramentada de dependencia económica<br /><br />RESPECTO DE LOS HERMANOS INVALIDOS Y HERMANOS MENORES DE EDAD (HUERFANOS)<br />- Registro civil de nacimiento auténtico del afiliado fallecido y el solicitante<br />-Declaración juramentada de dependencia económica', 'categoriaPrestacion', 'calidadBeneficiario', 'Seleccione un tipo de beneficiario', 2575, 179, 662, 10, '2022-10-24 12:01:15'),
(8, 2, 'Pensión Sobrevivientes (muerte del afiliado)', 'Es la prestación económica que se concede a los miembros del grupo familiar del pensionado por vejez o invalidez por riesgo común que fallezca (sustitución), o a los miembros del grupo familiar del afiliado que fallezca (pensión de sobrevivientes), cumpliendo los requisitos de la Ley vigente en el momento que acaece el riesgo de fallecimiento.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />- Registro Civil de Defunción (Auténtico y con una vigencia no mayor a 3 meses)<br />-En el evento de tratarse de un beneficiario invalido, que requiera personas de apoyo, de acuerdo con lo señalado en la Ley 1996 de 2019, debe allegar la providencia autentica de designación y posesión.<br /><br />RESPECTO DE CONYUGE O COMPAÑERA (O) PERMANENTE<br />-Registro Civil de Matrimonio CON NOTAS MARGINALES (Auténtico y con una vigencia no mayor a 3 meses)<br />-Registro Civil de Nacimiento del solicitante (Auténtico y con una vigencia no mayor a 3 meses y con notas marginales)<br />- declaraciones juramentadas de convivencia cinco años anteriores a la muerte del causante, manifestando los extremos temporales de la convivencia.<br /><br />RESPECTO DE LOS HIJOS<br />-Registro Civil de Nacimiento Autentico<br />-Certificado de estudios<br />-Dictamen de Calificación de Pérdida de Capacidad Laboral<br />-Declaración juramentada de dependencia económica.<br /><br />RESPECTO DE LOS PADRES<br />- Registro civil de nacimiento auténtico del afiliado fallecido<br />-Declaración juramentada de dependencia económica<br /><br />RESPECTO DE LOS HERMANOS INVALIDOS Y HERMANOS MENORES DE EDAD (HUERFANOS)<br />- Registro civil de nacimiento auténtico del afiliado fallecido y el solicitante<br />-Declaración juramentada de dependencia económica', 'categoriaPrestacion', 'calidadBeneficiario', 'Seleccione un tipo de beneficiario', 2575, 179, 665, 10, '2022-10-24 12:01:15'),
(9, 2, 'Acrecimiento de mesada', 'Es el incremento en el porcentaje de las prestaciones por muerte que se da a petición de parte al extinguirse el derecho pensional de algún beneficiario', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente  a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, después de la radicación virtual, los ORIGINALES de los siguientes documentos: <br /><br />  -Copia autentica el fallo judicial <br />-Constancia de ejecutoria y poder.', '', '', '', 2575, 179, 66, 10, '2022-10-24 12:01:15'),
(10, 2, 'Pago único a herederos', 'Son las sumas adeudadas al pensionado/ afiliado fallecido que causo un pago a su favor, pero que no fue cobrado previo a su fallecimiento, correspondiéndole dichos dineros a sus herederos', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente  a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, después de la radicación virtual, los ORIGINALES de los siguientes documentos: <br /><br />  la sentencia o escritura de la sucesión y registros civiles', '', '', '', 2575, 179, 596, 10, '2022-10-24 12:01:15'),
(11, 3, 'De la Pensión de Vejez', 'Tienen derecho a la indemnización sustitutiva de la pensión de vejez, las personas que habiendo cumplido la edad para obtener la pensión de vejez no hayan cotizado el mínimo de semanas exigidas por la ley 100 de 1993 para la pensión de vejez, y declaren su imposibilidad de continuar cotizando.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />-Registro Civil de Nacimiento Autentico<br />-Manifestación escrita de imposibilidad de continuar cotizando al sistema general de pensiones', '', '', '', 2575, 179, 664, 10, '2022-10-24 12:01:15'),
(12, 3, 'De la Pensión de Invalidez', 'Tienen derecho a la indemnización sustitutiva de la pensión de invalidez el afiliado que al momento de invalidarse no hubiere reunido los requisitos de semanas exigidos para la pensión de invalidez.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />-Registro Civil de Nacimiento Auténtico<br />-Dictamen de calificación de pérdida de capacidad laboral emitido por autoridad competente en caso de haber sido calificado.<br />-Constancia de ejecutoria del dictamen de calificación de pérdida de capacidad laboral', '', '', '', 2575, 179, 663, 10, '2022-10-24 12:01:15'),
(13, 3, 'De la Pensión de Sobrevivientes', 'Tienen derecho a la indemnización sustitutiva de la pensión de sobrevivientes. Los miembros del grupo familiar que prueben la calidad de beneficiarios del afiliado fallecido que al momento de su deceso no hubiese dejado causado el derecho de pensión de sobrevivientes', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />- Registro Civil de Defunción (Auténtico y con una vigencia no mayor a 3 meses)<br />-En el evento de tratarse de un beneficiario invalido, que requiera personas de apoyo, de acuerdo con lo señalado en la Ley 1996 de 2019, debe allegar la providencia autentica de designación y posesión.<br /><br />RESPECTO DE CONYUGE O COMPAÑERA (O) PERMANENTE<br />-Registro Civil de Matrimonio CON NOTAS MARGINALES (Auténtico y con una vigencia no mayor a 3 meses)<br />-Registro Civil de Nacimiento del solicitante (Auténtico y con una vigencia no mayor a 3 meses y con notas marginales)<br />- declaraciones juramentadas de convivencia cinco años anteriores a la muerte del causante, manifestando los extremos temporales de la convivencia.<br /><br />RESPECTO DE LOS HIJOS<br />-Registro Civil de Nacimiento Autentico<br />-Certificado de estudios<br />-Dictamen de Calificación de Pérdida de Capacidad Laboral<br />-Declaración juramentada de dependencia económica.<br /><br />RESPECTO DE LOS PADRES<br />- Registro civil de nacimiento auténtico del afiliado fallecido<br />-Declaración juramentada de dependencia económica<br /><br />RESPECTO DE LOS HERMANOS INVALIDOS Y HERMANOS MENORES DE EDAD (HUERFANOS)<br />- Registro civil de nacimiento auténtico del afiliado fallecido y el solicitante<br />-Declaración juramentada de dependencia económica', 'categoriaPrestacion', 'calidadBeneficiario', 'Seleccione un tipo de beneficiario', 2575, 179, 662, 10, '2022-10-24 12:01:15'),
(14, 4, 'Cesantías Definitivas / Parciales / Traslados FNA', 'Prestación Social que se reconoce a los empleados del Congreso afiliados a la Entidad: Puede ser definitiva cuando el empleado termina su vínculo laboral o parcial para compra, construcción, reparación, ampliación y mejora de vivienda; amortización o cancelación de hipoteca o para estudios del afiliado, cónyuge o para sus hijos, post mortem, aportando los documentos señalados en la norma. Los Certificados salariales y paz y salvos serán solicitados por Fonprecon al empleador.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />ADQUISICION DE VIVIENDA<br />- Contrato de promesa de compravent<br /><br />PARA REPARACIÓN, AMPLIACIÓN Y MEJORA DE VIVIENDA:<br />-Contrato de obra: el cual debe especificar la obra a realizar y el respectivo presupuesto detallado.<br />-Registro civil de matrimonio Autentico o Escritura de declaración de la unión marital de hecho: en el evento en que inmueble será de propiedad del cónyuge o compañero (a) permanente<br /><br />PARA AMORTIZACIÓN O CANCELACIÓN DE HIPOTECA:<br />-Certificación de la entidad financiera que contenga la información sobre el crédito (titular, identificación de la obligación y saldo actualizado) con fecha de expedición no mayor a un mes.<br /><br />PARA CONSTRUCCIÓN DE VIVIENDA:<br />Contrato de construcción o certificación original de constructora, el cual debe especificar la construcción a ejecutar o el respectivo presupuesto detallado.<br /><br />PARA ESTUDIOS:<br />-Orden de matrícula expedida por la institución, universidad o plantel educativo, en la que se indique el nombre del estudiante, valor de la matricula, pensión, semestre o deuda general por estos conceptos.<br />-Registro civil autentico de matrimonio o Escritura de declaración de la unión marital de hecho.<br />-Registro civil autentico de nacimiento de los hijos para probar parentesco, en el caso que los estudios sean para los hijos.', 'categoriaPrestacionDos', 'calidadBeneficiarioDos', 'Parciales, dependiendo del motivo del retiro debe anexar la siguiente documentación adicional:', 2575, 179, 657, 10, '2022-10-24 12:01:15'),
(15, 5, 'Auxilio funerario', 'Prestación Económica que se genera cuando fallece un afiliado o un pensionado. Se pagará a quien demuestre haber sufragado los gastos funerarios o exequiales, o a sus herederos en caso de presentarse un contrato preexequial cuyo titular sea el fallecido, en los montos establecidos en la Ley.', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente o por correo certificado a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, dentro del término de 1 mes después de la radicación virtual, los ORIGINALES de los siguientes documentos:<br /><br />- Registro Civil de Defunción<br />-Factura: A nombre de la persona natural que haya sufragado los gastos debidamente cancelada o certificación que acredite que se pagó y se prestó el servicio preexequial', '', '', '', 2575, 179, 656, 10, '2022-10-24 12:01:15'),
(16, 6, 'Cumplimiento de Sentencias', 'Presentación Económica de acatamiento a fallos judiciales proferidos a favor del demandante', 'Puede anexar soportes hasta un tamaño máximo de 20 MB en total por todos los documentos.<br /><br />* El formato soportado para la carga de anexos es PDF.<br />* Debe unificar y adjuntar en un solo PDF los soportes y/o documentos que requiere adjuntar para cada uno de los documentos solicitados.', 'Se requiere que allegue personalmente  a la Carrera 10 No. 24-55 Piso 2 en la ciudad de Bogotá, después de la radicación virtual, los ORIGINALES de los siguientes documentos: <br /><br />  -Copia autentica el fallo judicial <br />-Constancia de ejecutoria y poder', '', '', '', 2575, 179, 664, 10, '2022-10-24 12:01:15');
