(26, 7, 'Generales', 'providencia_autentica_designacion_y_posesion', 'Providencia autentica de designación y posesión', 'En el evento de tratarse de un beneficiario inválido, que requiera personas de apoyo, de acuerdo con lo señalado en la Ley 1996 de 2019, debe allegar la providencia autentica de designación y posesión', 10, 10, '2022-11-16 11:01:19'),
