(29, 7, 'Respecto de conyuge o compañera (o) permanente', 'declaracion_juramentada_convivencia_cinco_años_anteriores_muerte_causante', 'Declaración juramentada de convivencia cinco años anteriores a la muerte del causante', 'Tanto para la cónyuge como para compañera permanente, deberá aportar declaración juramentada de convivencia cinco años anteriores a la muerte del causante, manifestando los extremos temporales de la convivencia.', 10, 10, '2022-11-16 11:03:34'),
(30, 7, 'Respecto de conyuge o compañera (o) permanente', 'certificaciones_contratos_declaraciones_titulos_propiedad_de_bienes_muebles_inmuebles', 'Declaraciones de renta, títulos de propiedad de bienes, certificaciones sobre los beneficiarios', 'En aras de probar la convivencia deberá adjuntar las pruebas que considere pertinentes tales como: contratos, declaraciones de renta, títulos de propiedad de bienes muebles e inmuebles, certificación de la EPS sobre los beneficiarios, certificación de obligaciones comerciales y civiles mutuas, certificaciones bancarias de manejo de cuentas de manera conjunta y demás documentos que la Ley considere que sirven como prueba', 10, 10, '2022-11-16 11:08:13'),
(31, 7, 'Respecto de los hijos', 'registro_civil_nacimiento_hijos', 'Registro Civil de Nacimiento de los hijos', 'Registro Civil de Nacimiento de los hijos (Auténtico y con una vigencia no mayor a 3 meses)', 10, 10, '2022-11-16 11:08:13'),
(32, 7, 'Respecto de los hijos', 'documento_identidad', 'Documento de identidad', 'Documento de identidad', 10, 10, '2022-11-16 11:18:27'),
(33, 7, 'Respecto de los hijos', 'certificado_estudios', 'Certificado de estudios', 'Para los hijos mayores de 18 años y hasta los 25 años incapacitados para trabajar por razón de sus estudios, en consideración a lo contemplado en la Ley 1574 de 2012, donde se detalle la aprobación del establecimiento educativo por parte del Ministerio de Educación Nacional, el tipo de educación impartida, junto con la manifestación escrita que con la firma se entiende bajo la gravedad de juramento en la cual se establezca la dependencia económica del causante al momento de su muerte. - (Opcional)', 0, 10, '2022-11-16 11:18:27'),
(34, 7, 'Respecto de los hijos', 'dictamen_medico_laboral_emitido_por_junta_regional_o_nacional_calificacion_invalidez', 'Dictamen médico laboral emitido por la Junta Regional o Nacional de Calificación de invalidez', 'Para los hijos inválidos: dictamen médico laboral emitido por la Junta Regional o Nacional de Calificación de invalidez, si se cuenta con este, sino deberá solicitar previamente la calificación de pérdida de capacidad laboral ante Fonprecon adjuntando: Documento de identidad, Declaración del domicilio y Historia clínica actualizada', 10, 10, '2022-11-16 11:20:58'),
(35, 7, 'Respecto de los hijos', 'declaracion_de_dependencia_economica', 'Declaración de dependencia económica', 'Declaración de dependencia económica deberá ser aportada por los hijos mayores y los hijos inválidos. - (Opcional)', 0, 10, '2022-11-16 11:20:58'),
(36, 7, 'Respecto de los padres', 'acreditar_parentesco_con_registro_civil_nacimiento_autentico_afiliado_fallecido', 'Acreditar parentesco con el registro civil de nacimiento auténtico del afiliado fallecido', 'Acreditar parentesco con el registro civil de nacimiento auténtico del afiliado fallecido', 10, 10, '2022-11-16 11:23:36'),
(37, 7, 'Respecto de los padres', 'documento_identidad_padres_solicitantes', 'Documento de identidad de los padres solicitantes', 'Documento de identidad de los padres solicitantes', 10, 10, '2022-11-16 11:23:36'),
(38, 7, 'Respecto de los padres', 'copia_autentica_registro_civil_nacimiento_causante', 'Copia auténtica del registro civil de nacimiento del causante', 'Copia auténtica del registro civil de nacimiento del causante', 10, 10, '2022-11-16 11:26:13'),
(39, 7, 'Respecto de los padres', 'pruebas_dependencia_economica_con_causante_sobre_fuente_ingresos', 'Pruebas de dependencia económica con el causante sobre la fuente de sus ingresos', 'Pruebas de dependencia económica con el causante y además la manifestación escrita bajo la gravedad del juramento que se entiende prestado con la firma, sobre la fuente de sus ingresos para acreditar la dependencia económica del causante al momento de su muerte.', 10, 10, '2022-11-16 11:26:13'),
(40, 7, 'Respecto de los hermanos invalidos y hermanos menores de edad (huerfanos)', 'documento_identidad_solicitantes', 'Documento de identidad de los solicitantes', 'Documento de identidad de los solicitantes', 10, 10, '2022-11-16 11:27:54'),
(41, 7, 'Respecto de los hermanos invalidos y hermanos menores de edad (huerfanos)', 'pruebas_dependencia_economica_con_causante', 'Pruebas de dependencia económica con el causante', 'Pruebas de dependencia económica con el causante y además la manifestación escrita bajo la gravedad del juramento que se entiende prestado con la firma, sobre la fuente de sus ingresos para acreditar la dependencia económica del causante al momento de su muerte.', 10, 10, '2022-11-16 11:27:54'),
(42, 7, 'Respecto de los hermanos invalidos y hermanos menores de edad (huerfanos)', 'acreditar_parentesco_registro_civil_nacimiento_autentico_afiliado_fallecido_y_solicitante', 'Acreditar parentesco con el registro civil de nacimiento auténtico del afiliado fallecido y del solicitante', 'Acreditar parentesco con el registro civil de nacimiento auténtico del afiliado fallecido y del solicitante', 10, 10, '2022-11-16 11:30:44'),
(43, 7, 'Respecto de los hermanos invalidos y hermanos menores de edad (huerfanos)', 'dictamen_medico_laboral_emitido_por_junta_regional_calificacion_invalidez', 'Dictamen médico laboral emitido por la Junta Regional de Calificación de invalidez', 'Dictamen médico laboral emitido por la Junta Regional de Calificación de invalidez o la Junta Nacional de invalidez según el caso.', 10, 10, '2022-11-16 11:30:44'),
(44, 8, 'Generales', 'documento_identidad_solicitante_y_causante', 'Documento de identidad del solicitante y del causante', 'Documento de identidad del solicitante y del causante', 10, 10, '2022-11-16 11:49:33'),
