(68, 11, '', 'manifestacion_escrita_en_la_cual_indique_no_encuentra_afiliado_a_otra_administradora_pensiones', 'Manifestación escrita en la cual se indique que no se encuentra afiliado a otra Administradora de pensiones', 'Manifestación escrita que se entenderá rendida bajo la gravedad del juramento con la imposición de la firma, en la cual se indique que no se encuentra afiliado a otra Administradora de pensiones, que no tramita pensión en ninguna otra Entidad, que no recibe suma alguna del Tesoro Nacional por concepto de pensión, ni ha tramitado ningún tipo de prestación económica, devolución de aportes o indemnización sustitutiva que sea incompatible con el trámite de la pensión de jubilación o vejez que reclama.', 10, 10, '2022-11-16 13:53:22'),
