(70, 11, '', 'certificado_cetil_emitidos_por_empleador', 'Certificados CETIL emitidos por el empleador', 'Certificados CETIL emitidos por el empleador, donde se indique la fecha de ingreso, fecha de retiro, cargos desempeñados y licencias no remuneradas, los factores salariales y los descuentos efectuados con destino a la entidad de previsión social.', 10, 10, '2022-11-16 13:54:16'),
