(72, 12, '', 'certificacion_expedida_por_eps_estuvo_o_esta_afiliado_asegurado', 'Certificación expedida por la EPS a la cual estuvo o está afiliado el asegurado', 'Certificación expedida por la EPS a la cual estuvo o está afiliado el asegurado con posterioridad a la fecha de estructuración de la invalidez, en la que conste si se concedieron o no subsidios por incapacidad temporal con posterioridad a la fecha de estructuración de la invalidez. En el evento de haberse reconocido subsidios, la certificación deberá especificar las fechas de inicio y vencimiento de cada uno de ellos.', 10, 10, '2022-11-16 14:02:50'),
