INSERT INTO `cgGeneral` (`idCgGeneral`, `tamanoArchivoCgGeneral`, `diasLimiteCgGeneral`, `correoNotificadorAdminCgGeneral`, `correoNotificadorPqrsCgGeneral`, `diasNotificacionCgGeneral`, `terminoCondicionCgGeneral`, `diaRespuestaPqrsCgGeneral`, `idDependenciaPqrsCgGeneral`, `estadoCgGeneral`, `creacionCgGeneral`, `tiempoInactividadCgGeneral`, `iniConsClienteCgGeneral`, `resolucionesCgGeneral`, `resolucionesIdCgGeneral`, `resolucionesNameCgGeneral`, `codDepePrestaEconomicasCgGeneral`, `idPrestaPazYsalvoCgGeneral`) VALUES
(1, '2', 60, 'xxxxx@xxxxxxxx.gov.co', 'xxxxx@xxxxxx.com', 2, 'El presente Aviso de Privacidad establece los términos y condiciones en virtud de los cuales el Fondo de Previsión Social del Congreso de la República – FONPRECON, identificado con 899999734-7 con domicilio en la Carrera 10 No. 24-55, de la ciudad de Bogotá D.C., realizará el tratamiento de sus datos personales.\r\n\r\n<br><br>\r\n\r\n<b>1.TRATAMIENTO Y FINALIDAD:</b> El tratamiento que realizará el Fondo de Previsión Social del Congreso de la República – FONPRECON, con su información personal será el siguiente:\r\nLa recolección, almacenamiento, uso, circulación para el cumplimiento de los objetivos misionales, incluyendo estas operaciones:\r\n<br><br>\r\n\r\n- Efectuar las gestiones y dar cumplimiento al desarrollo de los objetivos misionales de la Entidad, en lo que tiene que ver la normatividad vigente en Colombia para las Administradoras de Pensiones y en particular para la administración del régimen de prima media con prestación definida, incluyendo cualquier requerimiento del Ministerio de Salud y Protección Social y otras entidades de regulación y control.\r\n<br>\r\n\r\n- Gestionar trámites (peticiones, solicitudes, quejas, reclamos).\r\n<br>\r\n\r\n- Efectuar encuestas de satisfacción respecto de los servicios ofrecidos por el Fondo de Previsión Social del Congreso de la República - FONPRECON.\r\n<br>\r\n\r\n- Suministrar información de contacto a cualquier tercero con el cual el Fondo de Previsión Social del Congreso de la República – FONPRECON, tenga un vínculo contractual para el desarrollo de actividades misionales o de apoyo.\r\n<br>\r\n\r\n- Contactar al Titular para realizar confirmación de datos personales, necesarios para la ejecución de una relación contractual o prestación del servicio.\r\nContactar al Titular para el envío de información de interés relacionada con la prestación del servicio.\r\n<br>\r\n\r\n- Dar cumplimiento a las obligaciones contraídas por el Fondo de Previsión Social del Congreso de la República – FONPRECON, con el Titular de la Información, con relación al pago de salarios, prestaciones sociales y demás retribuciones consagradas en el contrato de trabajo o según lo disponga la ley.\r\n<br>\r\n\r\n- Realizar invitaciones para estudios de mercado de proveedores.\r\n\r\n<br><br>\r\n\r\n<b>2. DERECHOS DEL TITULAR:</b> Como titular de sus datos personales Usted tiene derecho a:\r\n<br>\r\n\r\n(i) Acceder en forma gratuita a los datos proporcionados que hayan sido objeto de tratamiento.\r\n<br>\r\n\r\n(ii) Conocer, actualizar y rectificar su información frente a datos parciales, inexactos, incompletos, fraccionados, que induzcan a error, o a aquellos cuyo tratamiento esté prohibido o no haya sido autorizado.\r\n<br>\r\n\r\n(iii) Solicitar prueba de la autorización otorgada.\r\n<br>\r\n\r\n(iv) Presentar ante la Superintendencia de Industria y Comercio (SIC) quejas por infracciones a lo dispuesto en la normatividad vigente.\r\n<br>\r\n\r\n(v) Revocar la autorización y/o solicitar la supresión del dato, siempre que no exista un deber legal o contractual que impida eliminarlos.\r\n<br>\r\n\r\n(vi) Abstenerse de responder las preguntas sobre datos sensibles. Tendrá carácter facultativo las respuestas que versen sobre datos sensibles o sobre datos de las niñas y niños y adolescentes.\r\n\r\n<br><br>\r\n\r\n<b>3.MECANISMOS PARA CONOCER LA POLÍTICA DE TRATAMIENTO: </b> El Titular puede acceder a nuestra Política de Tratamiento de información, la cual se encuentra publicada en medio electrónico, en la página web de la Entidad en el siguiente enlace:', 5, 1, 10, '2020-10-01 00:00:00', 60, '7510', 10, 6, 'RESOLUCIONES', '400', 1972);
