INSERT INTO `gdTrdSubseries` (`idGdTrdSubserie`, `nombreGdTrdSubserie`, `codigoGdTrdSubserie`, `tiempoGestionGdTrdSubserie`, `tiempoCentralGdTrdSubserie`, `pSoporteGdTrdSubserie`, `eSoporteGdTrdSubserie`, `oSoporteGdTrdSubserie`, `ctDisposicionFinalGdTrdSubserie`, `eDisposicionFinalGdTrdSubserie`, `sDisposicionFinalGdTrdSubserie`, `mDisposicionFinalGdTrdSubserie`, `procedimientoGdTrdSubserie`, `estadoGdTrdSubserie`, `creacionGdTrdSubserie`, `normaGdTrdSubserie`, `idGdTrdSerie`) VALUES
(1, 'Actas de comité', '01', 2, 8, 10, 0, 0, 10, 0, 0, 0, 'En esta subserie se encuentra el  documento que muestra los resultados de una actividad, sirve para evaluar la ejecución de una tarea o un conjunto de tareas en relación con una determinada meta.  serie documental con valor administrativo. una vez se cumpla dos (2)  años de retención en el archivo de gestión que se contarón a partir del último informe a 31 de diciembre de cada año, posteriormente pasara ocho (8) años en el archivo central. cumplida esta última etapa los archivos serán eliminados  por método de  picado encontrando que este es el más idóneo y no genera daño ambiental de acuerdo a lo establecido en el procedimiento de la entidad, este proceso será planificado, revisado y supervisado  por el grupo de archivo y correspondencia haga sus veces. pierden su valor administrativo la información se consolida en el informe de gestión de la dirección general.', 10, '2023-01-31 22:06:30', NULL, 1),
(2, 'Informes a entes de control', '01', 2, 8, 10, 0, 0, 10, 0, 0, 10, 'En esta subserie se registran las respuestas a todos los requerimientos y auditorias de los entes de control relacionados con los procesos, avances y la toma de decisiones de la entidad. serie documental con valor administrativo e histírico de conservación total ya que reflejan el desarrollo,  cumplimiento y  ejecución de los procesos de la entidad.  una vez se cumpla dos (2)  años en el archivo de gestión que se contarón a partir del último informe de la vigencia fiscal, pasara ocho (8) años en el archivo central, posteriormente estos serán enviados al archivo histírico,  se realizaró la digitalización certificada proceso que será revisado por el grupo de archivo y correspondencia haga sus veces de acuerdo al procedimiento establecido por la entidad antes de realizar el traslado al archivo histírico. se debe conservar en soporte original y medio tecnológico. constitución poló­tica de colombia. artículos  119 y 278,  ley 734 de 2002.', 10, '2023-01-31 22:06:30', NULL, 2),
(3, 'Comunicaciones externas', '01', 2, 20, 10, 0, 0, 0, 0, 10, 10, 'En estos archivos se detallan los procesos para el reconocimiento de un auxilio monetario que se reconoce a quien ha demostrado haber asumido los gastos fúnebres de un afiliado o pensionado de acuerdo a lo establecido en la  ley 33 de 1985, decreto 2837 de 1986, ley 100 de 1993, decreto 1889 de 1994, ley 776 de 2002 y demás normas concordantes. el tiempo de retención establecido en el art. 9 del acuerdo 006 de 2011 del agn, por lo tanto en archivo de gestión tendrá una retención de dos (2)  años a partir de la notificación del  último acto administrativo de la prestación, una vez cumplido este término se transferirá para cumplir veinte (20) años en el archivo central a partir de la fecha en que se extinga el derecho a la prestación por cualquiera de las causales de ley según, por lo que solicitará al grupo de reconocimiento del fondo certificación en donde se establezca el no pago de mesadas.  cumplido último periodo se realizará la digitalización proceso que será revisado por el grupo de archivo y correspondencia haga sus veces,  para posteriormente ser transferido al archivo histírico, se debe conservar en soporte original  y medio tecnológico ya  cuenta con valores técnicos que refleja actividades misionales y operacionales de la entidad.', 10, '2023-01-31 22:06:30', NULL, 3),
(4, 'Comunicaciones internas', '02', 2, 20, 10, 0, 0, 0, 0, 10, 10, 'En estos archivos se detallan los procesos para el reconocimiento de un auxilio monetario que se reconoce a quien ha demostrado haber asumido los gastos fúnebres de un afiliado o pensionado de acuerdo a lo establecido en la  ley 33 de 1985, decreto 2837 de 1986, ley 100 de 1993, decreto 1889 de 1994, ley 776 de 2002 y demás normas concordantes. el tiempo de retención establecido en el art. 9 del acuerdo 006 de 2011 del agn, por lo tanto en archivo de gestión tendrá una retención de dos (2)  años a partir de la notificación del  último acto administrativo de la prestación, una vez cumplido este término se transferirá para cumplir veinte (20) años en el archivo central a partir de la fecha en que se extinga el derecho a la prestación por cualquiera de las causales de ley según, por lo que solicitará al grupo de reconocimiento del fondo certificación en donde se establezca el no pago de mesadas.  cumplido último periodo se realizará la digitalización proceso que será revisado por el grupo de archivo y correspondencia haga sus veces,  para posteriormente ser transferido al archivo histírico, se debe conservar en soporte original  y medio tecnológico ya  cuenta con valores técnicos que refleja actividades misionales y operacionales de la entidad.', 10, '2023-01-31 22:06:30', NULL, 3),
(5, 'Peticiones, quejas, reclamos y sugerencias', '01', 2, 20, 10, 0, 0, 0, 10, 10, 0, 'En estos documentos se establece la manera para realizar el pago de una prestación  a cargo del empleador y a favor del trabajador que corresponde en un mes de salario, tiene como objetivo principal dar un auxilio monetario cuando la persona termine su relación laboral de acuerdo con lo establecido en el ley 50 de 1990, decreto 906 de 1992, ley 244 de 1995, ley 1071 de 2006, decreto 019 de 2012 y demás normas concordantes. esta serie es misional útil para la construcción  de certificaciones laborales de los afiliados y funcionarios afiliados  al régimen de pensiones de fonprecon.  transcurrido los tiempos de retención en el archivo de gestión el cual será de dos (2) años a partir de la notificación del último acto administrativo de la prestación, una vez cumplido este término se transferirá al archivo central  para cumplir veinte (20) años una trascurra este último periodo, se debe realizar una selección cuantitativa por muestreo aleatorio simple del 10% tomando como población el total de solicitudes por año; después se proceder a realizar la digitalización sencilla como respaldo de la información para posteriormente trasladarse al archivo histórico, ya  cuenta con valores técnicos que refleja actividades misionales y operacionales de la entidad.  los archivos no seleccionados serán eliminados  por método de  picado de acuerdo al procedimiento de la entidad. estos procesos serán revisados por el grupo de archivo y correspondencia haga sus veces. se debe conservar en soporte original y medio tecnológico.', 10, '2023-01-31 22:06:31', NULL, 4);
